s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/gUdooiXuF_g/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:110:"https://wpml.org/2015/09/this-week-compatible-rtdating-altea-follow-my-blog-post-immonex-openimmo2wp/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 03 Sep 2015 14:11:10 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:22:"Compatibility Bulletin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=696913";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:307:"Today we are happy to announce that we have 2 themes and 2 plugins to add to our compatibility list. The theme is rtDating, Altea, and the plugins are Follow My Blog Post, Immonex OpenImmo2WP If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amit";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4951:"<p>Today we are happy to announce that we have 2 themes and 2 plugins to add to our compatibility list. The theme is <a title="rtDating" href="http://docs.rtcamp.com/rtdating/">rtDating</a>, <a title="Altea" href="http://www.little-neko.com/portfolio-item/altea-one-page-wordpress-theme/">Altea</a>, and the plugins are  <a title="Follow my blog post" href="http://codecanyon.net/item/follow-my-blog-post-wordpress-plugin/6107586">Follow My Blog Post</a>, <a title="Immonex OpenImmo2WP" href="https://plugins.inveris.de/shop/immonex-openimmo2wp/">Immonex OpenImmo2WP</a><br />\nIf you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a title="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class="feature">\n<h2 style="text-align: center;">rtDating theme</h2>\n<p style="text-align: center;"><a href="http://docs.rtcamp.com/rtdating/"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/rtdating.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Unique, clean and modern theme useful for dating sites and community website.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://docs.rtcamp.com/rtdating/" target="_blank">Purchase rtDating theme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Altea theme</h2>\n<p style="text-align: center;"><a href="http://www.little-neko.com/portfolio-item/altea-one-page-wordpress-theme/"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/altea.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Altea is lightweight, one-page, multi-purpose WordPress theme.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://www.little-neko.com/portfolio-item/altea-one-page-wordpress-theme/">Purchase Altea theme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Follow my Blog Post plugin</h2>\n<p style="text-align: center;"><a href="http://codecanyon.net/item/follow-my-blog-post-wordpress-plugin/6107586"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/follow.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>This plugin allows your users to follow changes on a particular post/page for your WordPress site.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://codecanyon.net/item/follow-my-blog-post-wordpress-plugin/6107586">Purchase Follow my Blog Post Plugin</a>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Immonex OpenImmo2WP plugin</h2>\n<p style="text-align: center;"><a href="https://plugins.inveris.de/shop/immonex-openimmo2wp/"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/09/immonex.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>This plugin is a lightweight solution for importing and frequently updating OpenImmo XML real estate data into WordPress sites based on various popular themes</p></blockquote>\n<p><a class="button download-button vt-p" href="https://plugins.inveris.de/shop/immonex-openimmo2wp/">Purchase Immonex OpenImmo2WP plugin</a>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=gUdooiXuF_g:CQSDaKe2lFo:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=gUdooiXuF_g:CQSDaKe2lFo:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=gUdooiXuF_g:CQSDaKe2lFo:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=gUdooiXuF_g:CQSDaKe2lFo:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=gUdooiXuF_g:CQSDaKe2lFo:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=gUdooiXuF_g:CQSDaKe2lFo:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/gUdooiXuF_g" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:106:"https://wpml.org/2015/09/this-week-compatible-rtdating-altea-follow-my-blog-post-immonex-openimmo2wp/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:101:"https://wpml.org/2015/09/this-week-compatible-rtdating-altea-follow-my-blog-post-immonex-openimmo2wp/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:61:"This week compatible – Elbe Blake, Identity, Elision, Evoke";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}