entity-multionepage-business-wordpress-theme/9101950">Identity</a>, <a title="Elision" href="http://themeforest.net/item/elision-retina-multipurpose-wordpress-theme/6382990">Elision</a>, <a title="Evoke" href="http://themeforest.net/item/evoke-photo-stories-wordpress-blog-theme/10707534">Evoke</a><br />\nIf you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a title="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class="feature">\n<h2 style="text-align: center;">Elbe Blake theme</h2>\n<p style="text-align: center;"><a href="http://www.web-savvy-marketing.com/store/elbe-blake/"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/elbe.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Elbe Blake is a WordPress marketing theme designed for marketing consultants, freelancers, or small agencies. This Genesis child theme has seven color options, lots of features, and it is SEO friendly.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://www.web-savvy-marketing.com/store/elbe-blake/" target="_blank">Purchase Elbe Blake theme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Identity theme</h2>\n<p style="text-align: center;"><a href="http://themeforest.net/item/identity-multionepage-business-wordpress-theme/9101950"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/identity.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Identity is a Multi/One Page WordPress Theme that can fit creative design agency, web development agency, start-up company or any business company.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://themeforest.net/item/identity-multionepage-business-wordpress-theme/9101950">Purchase Identity theme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Elision theme</h2>\n<p style="text-align: center;"><a href="http://themeforest.net/item/elision-retina-multipurpose-wordpress-theme/6382990"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/elision.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>ELISION is a retina multi-purpose WordPress theme.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://themeforest.net/item/elision-retina-multipurpose-wordpress-theme/6382990">Purchase Elision theme</a>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Evoke theme</h2>\n<p style="text-align: center;"><a href="http://themeforest.net/item/evoke-photo-stories-wordpress-blog-theme/10707534"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/evoke.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Evoke is a WordPress photo blog theme for writers and for those who like to share their stories in a simple and elegant way ( travelers, bloggers, photographers etc.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://themeforest.net/item/evoke-photo-stories-wordpress-blog-theme/10707534">Purchase Evoke theme</a>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=Oq-7RWFfhkk:_T_UrML3MQ0:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=Oq-7RWFfhkk:_T_UrML3MQ0:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=Oq-7RWFfhkk:_T_UrML3MQ0:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=Oq-7RWFfhkk:_T_UrML3MQ0:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=Oq-7RWFfhkk:_T_UrML3MQ0:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=Oq-7RWFfhkk:_T_UrML3MQ0:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/Oq-7RWFfhkk" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:85:"https://wpml.org/2015/08/this-week-compatible-elbe-blake-identity-elision-evoke/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:80:"https://wpml.org/2015/08/this-week-compatible-elbe-blake-identity-elision-evoke/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:103:"WooCommerce Compatibility – Multi Vendor, Ajax Layered Navigation, Composite Products, Product Alerts";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/LAAAE0RlzFM/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:131:"https://wpml.org/2015/08/woocommerce-compatibility-multi-vendor-ajax-layered-navigation-composite-products-product-alerts/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 20 Aug 2015 13:44:40 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:22:"Compatibility Bulletin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=683295";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:380:"WooCommerce Multilingual is a very important project for us, today we are happy to announce that we have 4 WooCommerce Extensions to add to our compatibility list. The extensions are YITH WooCommerce Multi Vendor, WooCommerce Ajax Layered Navigation, WooCommerce Composite Products, Product Alerts for WooCommerce If you want to review the entire multilingual ready list [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amit";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4877:"<p><a href="https://wordpress.org/plugins/woocommerce-multilingual/" title="WooCommerce Multilingual" target="_blank">WooCommerce Multilingual</a> is a very important project for us, today we are happy to announce that we have 4 WooCommerce Extensions to add to our compatibility list. </p>\n<p>The extensions are <a title="YITH WooCommerce Multi Vendor" href="https://wordpress.org/plugins/yith-woocommerce-product-vendors/">YITH WooCommerce Multi Vendor</a>, <a title="WooCommerce Ajax Layered Navigation" href="http://www.woothemes.com/products/ajax-layered-navigation/">WooCommerce Ajax Layered Navigation</a>, <a title="WooCommerce Composite Products" href="http://www.woothemes.com/products/composite-products/">WooCommerce Composite Products</a>, <a title="Product Alerts for WooCommerce" href="http://codecanyon.net/item/product-alerts-for-woocommerce/7301935">Product Alerts for WooCommerce</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a title="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class="feature">\n<h2 style="text-align: center">YITH WooCommerce Multi Vendor</h2>\n<p style="text-align: center"><a href="https://wordpress.org/plugins/yith-woocommerce-product-vendors/"></a></p>\n<blockquote><p>YITH WooCommerce Multi Vendor is a plugin developed to switch your website into a platform hosting more than one shop, like a multivendor marketplace.</p></blockquote>\n<p style="text-align: center"><a class="button download-button vt-p" href="https://wordpress.org/plugins/yith-woocommerce-product-vendors/">Download YITH WooCommerce Multi Vendor</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center">WooCommerce Ajax Layered Navigation</h2>\n<p style="text-align: center"><a href="http://www.woothemes.com/products/ajax-layered-navigation/"></a></p>\n<blockquote><p>Ajax enabled layered nav widgets for your store.</p></blockquote>\n<p style="text-align: center"><a class="button download-button vt-p" href="http://www.woothemes.com/products/ajax-layered-navigation/" target="_blank">Purchase WooCommerce Ajax Layered Navigation</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center">WooCommerce Composite Products</h2>\n<p style="text-align: center"><a href="http://www.woothemes.com/products/composite-products/"></a></p>\n<blockquote><p>Create complex, configurable product kits and let your customers build their own, personalized versions.</p></blockquote>\n<p style="text-align: center"><a class="button download-button vt-p" href="http://www.woothemes.com/products/composite-products/">Purchase WooCommerce Composite Products</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center">Product Alerts for WooCommerce</h2>\n<p style="text-align: center"><a href="http://codecanyon.net/item/product-alerts-for-woocommerce/7301935"></a></p>\n<blockquote><p>Give your customers the ability to signup and receive email notifications on any products they select.</p></blockquote>\n<p style="text-align: center"><a class="button download-button vt-p" href="http://codecanyon.net/item/product-alerts-for-woocommerce/7301935">Purchase Product Alerts for WooCommerce</a></p>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=LAAAE0RlzFM:FqfPGkRri20:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=LAAAE0RlzFM:FqfPGkRri20:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=LAAAE0RlzFM:FqfPGkRri20:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=LAAAE0RlzFM:FqfPGkRri20:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=LAAAE0RlzFM:FqfPGkRri20:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=LAAAE0RlzFM:FqfPGkRri20:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/LAAAE0RlzFM" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:127:"https://wpml.org/2015/08/woocommerce-compatibility-multi-vendor-ajax-layered-navigation-composite-products-product-alerts/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:122:"https://wpml.org/2015/08/woocommerce-compatibility-multi-vendor-ajax-layered-navigation-composite-products-product-alerts/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:25:"WPML 3.2.4 and then 3.2.5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/GqZsti4-0ag/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:60:"https://wpml.org/2015/08/wpml-3-2-4-and-then-3-2-5/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 19 Aug 2015 22:15:35 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"WPML versions";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=682770";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:328:"We just released two quick updates for WPML. These updates addresses a few smaller things that came up from support after the bigger WPML 3.2.3 update. Fixed a performance issue when looking up pages by slug and having a very large number of posts in the database &#8211; we&#8217;re not sure if anyone except wpml.org [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amir";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2839:"<p><strong>We just released two quick updates for WPML. These updates addresses a few smaller things that came up from support after the bigger WPML 3.2.3 update.</strong></p>\n<ul>\n<li>Fixed a performance issue when looking up pages by slug and having a very large number of posts in the database &#8211; we&#8217;re not sure if anyone except wpml.org could notice this problem. A change to an SQL statement caused heavy load on our database server. We traced it to a recent change that solved a bug. This change was enhanced to solve the bug without causing DB load. Again, this issue was only noticeable on very large databases running under heavy load (like wpml.org site).</li>\n<li>Solved the problem when, in some cases, WPML was showing a corrupted settings warning &#8211; a sequence of batch plugin activations, deactivation and activation again could trigger a scary message about settings being corrupted. Even though this doesn&#8217;t cause any real problem, we think that it&#8217;s scary enough to justify a quick fix.</li>\n<li>Fixed the xdomain script not always running, due to a dependency issue &#8211; in some cases, JS resources were not loaded.</li>\n<li>Solved a problem where page slugs where given precedence over custom post type slugs when resolving permalinks, even though the URI specified the custom post type &#8211; solving this bug was what caused the performance problem for huge sites.</li>\n</ul>\n<p>We understand that updating plugins is a hassle and we try to limit our updates to only the necessary ones. As I am writing this post, our developers are adding more and more automated testing to WPML. Our goal is to achieve 100% test coverage until the end of 2015. This will allow us to release updates without the fear of causing side effects. Currently, our QA cycle takes a staggering 20 work-weeks. It&#8217;s run by 4 people during a whole month. We run several thousands of tests on many configurations. The amount of testing is huge and we&#8217;re looking to replace much of it with automated testing.</p>\n<p>Questions? Ideas? Suggestions? Leave your comment and we&#8217;ll get back to you.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=GqZsti4-0ag:IQ3x5bcy1JA:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=GqZsti4-0ag:IQ3x5bcy1JA:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=GqZsti4-0ag:IQ3x5bcy1JA:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=GqZsti4-0ag:IQ3x5bcy1JA:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=GqZsti4-0ag:IQ3x5bcy1JA:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=GqZsti4-0ag:IQ3x5bcy1JA:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/GqZsti4-0ag" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:56:"https://wpml.org/2015/08/wpml-3-2-4-and-then-3-2-5/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"6";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:51:"https://wpml.org/2015/08/wpml-3-2-4-and-then-3-2-5/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:28:"WPML 3.2.3 for WordPress 4.3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/YkubJxH2R0k/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:63:"https://wpml.org/2015/08/wpml-3-2-3-for-wordpress-4-3/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 18 Aug 2015 19:41:42 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"WPML versions";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=681798";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:340:"We just pushed the official update for WPML 3.2.3. This version includes all necessary updates for WordPress 4.3, as well as a number of other improvements. This update should appear in your WordPress dashboard in a few hours (depending on the WordPress updates cache). Please be sure to update WPML before you update WordPress to [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amir";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2027:"<p>We just pushed the official update for WPML 3.2.3. This version includes all necessary updates for WordPress 4.3, as well as a number of other improvements.</p>\n<p>This update should appear in your WordPress dashboard in a few hours (depending on the WordPress updates cache). Please be sure to update WPML before you update WordPress to 4.3.</p>\n<p>The easiest way to update WPML is by registering it and letting the automatic update to its magic. You can always update manually by downloading the recent ZIP files from your <a href="https://wpml.org/account/">wpml.org account</a>.</p>\n<p>Experience tells us that things can go wrong. This update of WordPress introduces several API changes (nothing like the huge API change in WordPress 4.2.3). These changes may effect your theme and plugins. We recommend that you make full backup of your site before the update and carefully test functionality after.</p>\n<p>The full list of features is listed in the <a href="https://wpml.org/2015/08/wpml-3-2-3-release-candidate-with-wordpress-4-3-support/">WPML 3.2.3 RC</a>. There&#8217;s also an important <a href="https://wpml.org/2015/08/update-to-widget-titles-translation-in-wpml-3-2-3/">technical note about translation for widget titles</a>.</p>\n<p>Feedback? Ideas? Questions? Leave your comments and we&#8217;ll reply.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=YkubJxH2R0k:gQ6WV-MbS5c:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=YkubJxH2R0k:gQ6WV-MbS5c:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=YkubJxH2R0k:gQ6WV-MbS5c:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=YkubJxH2R0k:gQ6WV-MbS5c:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=YkubJxH2R0k:gQ6WV-MbS5c:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=YkubJxH2R0k:gQ6WV-MbS5c:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/YkubJxH2R0k" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:59:"https://wpml.org/2015/