ersions of WPML, we did not correctly catch strings for widget titles. As a result, our support team suggested a workaround. The workaround involved getting these strings via the &#8216;admin strings&#8217; mechanism. Now that the original problem is resolved in WPML 3.2.3, you may see the same string appearing twice. In this post, [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:9:"enclosure";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:3:"url";s:72:"http://d1ftqtsbckf6jv.cloudfront.net/wpml-string-translation-widgets.mp4";s:6:"length";s:8:"15332934";s:4:"type";s:9:"video/mp4";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amir";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2236:"<p><strong>In previous versions of WPML, we did not correctly catch strings for widget titles. As a result, our support team suggested a workaround. The workaround involved getting these strings via the &#8216;admin strings&#8217; mechanism. Now that the original problem is resolved in WPML 3.2.3, you may see the same string appearing twice. In this post, we explain how to delete the duplicate and make sure that widget titles are translated correctly.</strong></p>\n<p>This video shows what&#8217;s happening and how to update your strings:</p>\n<p style="text-align: center;"><a onclick="popupVideo(1460,744,''http://d1ftqtsbckf6jv.cloudfront.net/wpml-string-translation-widgets.mp4'');" href="#"><strong>Play Video »</strong></a></p>\n<p>If you previously had problems translating widget titles and you had to go to WPML-&gt;String Translation-&gt;Admin strings to locate them, this is no longer necessary. We recommend to delete these &#8216;admin_text&#8217; strings. Otherwise, you will see the same sting appearing twice. This can be confusing when translating.</p>\n<p><a onclick="popupVideo(1460,744,''http://d1ftqtsbckf6jv.cloudfront.net/wpml-string-translation-widgets.mp4'');" href="#">Watch the video</a> to see what was the previous work-around and how to switch back to normal widgets translation.</p>\n<p>Please note that if you don&#8217;t do this change, your sites will continue working normally. We are suggesting to do this cleanup to remove unneeded strings and prevent confusion in updating strings in the future.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=mnzzzZ5hD2s:fQ8SP37rfAE:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=mnzzzZ5hD2s:fQ8SP37rfAE:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=mnzzzZ5hD2s:fQ8SP37rfAE:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=mnzzzZ5hD2s:fQ8SP37rfAE:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=mnzzzZ5hD2s:fQ8SP37rfAE:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=mnzzzZ5hD2s:fQ8SP37rfAE:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/mnzzzZ5hD2s" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:80:"https://wpml.org/2015/08/update-to-widget-titles-translation-in-wpml-3-2-3/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:75:"https://wpml.org/2015/08/update-to-widget-titles-translation-in-wpml-3-2-3/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:55:"WPML 3.2.3 Release Candidate with WordPress 4.3 Support";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/sT_ze860IuU/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:90:"https://wpml.org/2015/08/wpml-3-2-3-release-candidate-with-wordpress-4-3-support/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 14 Aug 2015 09:05:44 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"WPML versions";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=679532";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:358:"We just released another (and hopefully) final dev version of WPML 3.2.3. This version has passed our QA and is considered safe for development and production sites. WPML 3.2.3 comes with a long list of improvements, as well as complete compatibility with WordPress 4.3. WordPress 4.3 updates Like other WordPress releases, WordPress 4.3 comes with [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amir";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:7299:"<p><strong>We just released another (and hopefully) final dev version of WPML 3.2.3. This version has passed our QA and is considered safe for development and production sites. WPML 3.2.3 comes with a long list of improvements, as well as complete compatibility with WordPress 4.3.</strong></p>\n<h2>WordPress 4.3 updates</h2>\n<p>Like other WordPress releases, WordPress 4.3 comes with a number of enhancements and code cleanups. This means that some functions that used to exist before 4.3 are now deprecated (should no longer be used). WPML 3.2.3 includes the required changes and uses replacement functions instead of the deprecated ones.</p>\n<p>If you are building WordPress sites right now, you should do your development on the dev version of WordPress 4.3. This way, when 4.3 is released, you don&#8217;t need to do any last-minute changes to your work. WPML 3.2.3 makes this possible. So, we recommend that you switch your development sites to WordPress 4.3 (dev) and WPML 3.2.3 (this RC).</p>\n<h2>Other improvements in WPML 3.2.3</h2>\n<p>Besides the important changes to support WordPress 4.3, this release of WPML comes with a number of important fixes and improvements.</p>\n<h3>WPML Core</h3>\n<p><strong>Fixes</strong></p>\n<ul>\n<li>Fixed missing parentheses in mobile switcher</li>\n<li>Changing admin language on one site (multisite) does not sets admin language on all sites anymore</li>\n<li>When &#8216;Language as Parameter&#8217; is used, wp_link_pages() pagination produce now a properly formed URL</li>\n<li>Fixed WPML breaking XML-RPC calls</li>\n<li>Fixed wrong order of languages when using icl_get_languages with orderby=name</li>\n<li>Fixed redirection issues when the same slug is used in translations with hierarchical post types</li>\n<li>Fixed page template being unchangeable in translated content, after deactivating the &#8220;Synchronize page template&#8221; setting</li>\n<li>Fixed &#8220;This is a translation of&#8221; being empty when creating a new translation</li>\n<li>Fixed &#8220;This is a translation of&#8221; so it&#8217;s enabled correctly</li>\n<li>Removed errors when deactivating WPML for a subsite in multisite install</li>\n<li>Fixed an issue preventing subsites in a subdirectory multisite setup from completing the last setup step</li>\n<li>Removed creation of duplicated &#8216;update_wpml_config_index&#8217; cron job</li>\n<li>Fixed domain name mapping when a domain name in one language includes the domain name from another language.</li>\n<li>Fixed problem with Greek characters in taxonomy names causing problems with taxonomy translations editor</li>\n<li>Fixed language switcher not filtering out empty date archive translations</li>\n<li>Fixed issues resolving hierarchical page URLs when parent and child use the same page-slug</li>\n<li>Fixed issue where urls pointing at hidden language posts were redirected incorrectly when using the languages as parameters setting.</li>\n<li>Fixed &#8216;wpml_active_languages&#8217; filter so it returns languages with correct data.</li>\n</ul>\n<p><strong>Improvements</strong></p>\n<ul>\n<li>Improved caching of posts, taxonomy translation data, and strings</li>\n<li>Improved performances</li>\n<li>Wildcard entries for admin string settings now work for sub-keys on all levels in addition to top-level keys</li>\n<li>Improved menus synchronization (by a factor of 100)</li>\n</ul>\n<h3>WPML Translation Management</h3>\n<p><strong>Fixes</strong></p>\n<ul>\n<li>Translation Editor shows existing translated content, if there was a previous translation</li>\n<li>Translation Editor won&#8217;t changes language pairs for translators anymore</li>\n<li>Titles for packages and posts won&#8217;t get mixed up in the translation jobs table anymore</li>\n<li>Users set as translators can translate content again, using the translation editor, even if there is not a translation job created for that content</li>\n</ul>\n<h3>WPML String Translation</h3>\n<p><strong>Fixes</strong></p>\n<ul>\n<li>Fixed a problem with slug translation showing translated slug for English on Multilingual Content Setup when Admin language is other than English</li>\n<li>Fixed slug translation so it works with the default permalink structure.</li>\n<li>Fixed caching problem with admin texts which caused some admin texts to not update correctly.</li>\n<li>Removed PHP Fatal error: Specified key was too long; max key length is 1000 bytes caused by gettext_context_md5</li>\n<li>Fixed string scanning issues</li>\n<li>Fixed slug translations so that they are not used when they are disabled</li>\n<li>Fixed Auto register strings for translation</li>\n<li>Fixed admin texts so the settings are loaded from the default language and not the administrator&#8217;s language</li>\n<li>Fixed fatal error when an old version of WPML is active</li>\n</ul>\n<p><strong>New</strong></p>\n<ul>\n<li>Support multi-line strings when importing and exporting po files</li>\n<li>Support gettext contexts in string translation</li>\n<li>Updated dependency check module</li>\n</ul>\n<h3>WPML Gravity Forms Multilingual</h3>\n<p><strong>Improvements</strong></p>\n<ul>\n<li>It&#8217;s now possible to translate all &#8220;choices&#8221; options (labels and values) of fields with this property</li>\n</ul>\n<h2>Download and update</h2>\n<p>Since this is still not a production release, it will not be automatically delivered to your WordPress sites. To get this release candidate, log in to your <a href="https://wpml.org/account/">WPML account</a> and click on <strong>Downloads</strong>. Scroll to the bottom. If you have a CMS account, get the CMS_Beta_Package and unzip it. It will include ZIP files of all of WPML&#8217;s components. If you have a Blog account, download the Blog beta.</p>\n<p>Please <strong>backup the site</strong> before upgrading. Be sure to update all WPML components that you are using.</p>\n<h2>When is the official release?</h2>\n<p>This version of WPML has passed all our testing and is ready for a public release. We are hoping to get some feedback on how this update works for you, especially on WordPress 4.3 sites. We will wait for this feedback until the beginning of next week and then hit the Publish button.</p>\n<h2>Feedback?</h2>\n<p>We&#8217;d love to know how this update works on your sites. If you need technical help, please create threads in our <a href="https://wpml.org/forums/forum/english-support/">technical support forum</a>. If these are related to this update, you can also leave a comment here with the link to the thread, and a brief description. For anything else that&#8217;s less technical, leave your comments here and we&#8217;ll reply.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=sT_ze860IuU:2O8cOrtoWac:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=sT_ze860IuU:2O8cOrtoWac:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=sT_ze860IuU:2O8cOrtoWac:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=sT_ze860IuU:2O8cOrtoWac:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=sT_ze860IuU:2O8cOrtoWac:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=sT_ze860IuU:2O8cOrtoWac:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/sT_ze860IuU" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:86:"https://wpml.org/2015/08/wpml-3-2-3-release-candidate-with-wordpress-4-3-support/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"21";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:81:"https://wpml.org/2015/08/wpml-3-2-3-release-candidate-with-wordpress-4-3-support/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:63:"This week compatible – LVY, Custom Post Widget, EU Cookie Law";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/KXCkxFuIngc/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:92:"https://wpml.org/2015/08/this-week-compatible-lvy-custom-post-widget-eu-cookie-law/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 13 Aug 2015 17:14:11 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:22:"Compatibility Bulletin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:26:"https://wpml.org/?p=679103";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:293:"Today we are happy to announce that we have 1 theme and 2 plugins to add to our compatibility list. The theme is LVY, and the plugins are Custom Post Widget, EU Cookie Law If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amit";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4040:"<p>Today we are happy to announce that we have 1 theme and 2 plugins to add to our compatibility list. The theme is <a title="LVY" href="http://demo.flothemes.com/?theme=lvy">LVY</a>, and the plugins are <a title="Custom Post Widget" href="https://wordpress.org/plugins/custom-post-widget/">Custom Post Widget</a>, <a title="EU Cookie Law" href="https://wordpress.org/plugins/eu-cookie-law/">EU Cookie Law</a><br />\nIf you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a title="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class="feature">\n<h2 style="text-align: center;">LVY theme</h2>\n<p style="text-align: center;"><a href="http://demo.flothemes.com/?theme=lvy"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/lvy.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Lovely is customizable and minimalistic WordPress theme suitable for for photographers.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://demo.flothemes.com/?theme=lvy" target="_blank">Purchase LVY theme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Custom Post Widget</h2>\n<p style="text-align: center;"><a href="https://wordpress.org/plugins/custom-post-widget/"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/cpw.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>This plugin enables you to edit and display Content Blocks in a sidebar widget or using a shortcode.</p></blockquote>\n<p><a class="button download-button vt-p" href="https://wordpress.org/plugins/custom-post-widget/">Download Custom Post Widget</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">EU Cookie Law</h2>\n<p style="text-align: center;"><a href="https://wordpress.org/plugins/eu-cookie-law/"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/eu.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>EU Cookie Law informs users that your site uses cookies, with option to lock scripts before consent. Light + Customizable style.</p></blockquote>\n<p><a class="button download-button vt-p" href="https://wordpress.org/plugins/eu-cookie-law/">Download EU Cookie Law</a>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=KXCkxFuIngc:rXxYzZwx64Q:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=KXCkxFuIngc:rXxYzZwx64Q:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=KXCkxFuIngc:rXxYzZwx64Q:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=KXCkxFuIngc:rXxYzZwx64Q:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=KXCkxFuIngc:rXxYzZwx64Q:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=KXCkxFuIngc:rXxYzZwx64Q:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/KXCkxFuIngc" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:88:"https://wpml.org/2015/08/this-week-compatible-lvy-custom-post-widget-eu-cookie-law/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:83:"https://wpml.org/2015/08/this-week-compatible-lvy-custom-post-widget-eu-cookie-law/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"Help us know which import plugin you use for WPML";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://