we would like to hear from you; if you have some experience with one of these available plugins please tell us about it. If you are an author of an import / export WordPress plugin drop us a line and we’ll start working together.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=_NQGz0R-4v4:xh4rgTsfPgE:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=_NQGz0R-4v4:xh4rgTsfPgE:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=_NQGz0R-4v4:xh4rgTsfPgE:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=_NQGz0R-4v4:xh4rgTsfPgE:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=_NQGz0R-4v4:xh4rgTsfPgE:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=_NQGz0R-4v4:xh4rgTsfPgE:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/_NQGz0R-4v4" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:80:"https://wpml.org/2015/08/help-us-know-which-import-plugin-you-use-for-wpml/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"21";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:75:"https://wpml.org/2015/08/help-us-know-which-import-plugin-you-use-for-wpml/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";