 compatibility list. The themes are <a title="Photon" href="http://themeforest.net/item/photon-fullscreen-photography-wordpress-theme/11543656">Photon</a>, <a title="Beckett" href="http://themetrust.com/themes/beckett/">Beckett</a>, <a title="Lotus" href="http://themeforest.net/item/lotus-flexible-multipurpose-responsive-wp-theme/3909293">Lotus</a>, <a title="Park College" href="http://themeforest.net/item/parkcollege-education-responsive-wp-theme/4857701">Park College</a><br />\nIf you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a title="Multilingual Ready Themes " href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a title="Multilingual Ready Plugins " href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you&#8217;re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process we strongly recommend that you test your theme or plugin with our <a title="Achieving WPML compatibility for your themes and plugins" href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin <strong>Multilingual Ready</strong>.</p>\n<div class="feature">\n<h2 style="text-align: center;">Photon theme</h2>\n<p style="text-align: center;"><a href="http://themeforest.net/item/photon-fullscreen-photography-wordpress-theme/11543656"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/photon1.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Photon is the Responsive Full screen Portfolio WordPress Theme for Photographers and other Creatives to showcase their latest works.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://themeforest.net/item/photon-fullscreen-photography-wordpress-theme/11543656" target="_blank">Purchase Photon theme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Beckett theme</h2>\n<p style="text-align: center;"><a href="http://themetrust.com/themes/beckett/"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/beckett.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Beckett is a minimal portfolio WordPress theme that include grid portfolio layouts.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://themetrust.com/themes/beckett/">Purchase Beckett theme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Lotus theme</h2>\n<p style="text-align: center;"><a href="http://themeforest.net/item/lotus-flexible-multipurpose-responsive-wp-theme/3909293"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/lotus.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Lotus, Flexible Multipurpose &#038; Responsive WordPress Theme.</p></blockquote>\n<p><a class="button download-button vt-p" href="http://themeforest.net/item/lotus-flexible-multipurpose-responsive-wp-theme/3909293">Purchase Lotus theme</a>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Park College theme</h2>\n<p style="text-align: center;"><a href="http://themeforest.net/item/parkcollege-education-responsive-wp-theme/4857701"><img class="aligncenter size-full wp-image-340493" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2015/08/park.png" alt="ekho" width="590" height="300" /></a></p>\n<blockquote><p>Park College is a WordPress theme designed with learning inst