(717, '_transient_dash_bd94b8f41e74bae2f4dc72e9bd8379af', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/WordpressFrancophone/~3/ayO_P6QzZyY/''>L’Hebdo WordPress n°263 du 10e anniversaire</a> <span class="rss-date">28 août 2015</span><div class="rssSummary">WPFR a 10 ans ! Il était une fois WordPress Francophone… Cette histoire a commencé il y a 10 ans par la volonté de quelques utilisateurs qui voulaient avoir un espace d’échange en français pour ne plus se faire rejeter des forums officiels allergiques aux non anglophones. Et un nouveau site wordpress-fr.net était né ! [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/feedburner/cjgL/~3/Og4g9561NEU/''>L’Hebdo WordPress n°263 du 10e anniversaire</a></li><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/feedburner/cjgL/~3/D2YW8pSwmLs/''>Sortie de  WordPress 4.3 « Billie »</a></li><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/feedburner/cjgL/~3/0Fxaf6P1QkI/''>L’Hebdo WordPress n°262 : Communautés – Retours d’expérience – Astuces</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Extensions populaires:</span> <a href=''https://wordpress.org/plugins/siteorigin-panels/'' class=''dashboard-news-plugin-link''>Page Builder by SiteOrigin</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=siteorigin-panels&amp;_wpnonce=8c78677f16&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Page Builder by SiteOrigin''>Installer</a>)</span></li></ul></div>', 'no'),
